import classes from './Header.module.css';
import { Input } from 'antd';
import img1 from '../images/forky.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons'
import { faPenToSquare } from '@fortawesome/free-solid-svg-icons'
import { faBookmark } from '@fortawesome/free-solid-svg-icons'

const glass = <FontAwesomeIcon className={classes.search} icon={faMagnifyingGlass} />
const recipe = <FontAwesomeIcon icon={faPenToSquare} />
const bookmark = <FontAwesomeIcon icon={faBookmark} />
const { Search } = Input;

function Header(){
    const onSearch = (value) => {
        console.log(value, 'ad')
    }

    return (
        <div className={classes.header}>
            <img className={classes.image} src={img1} alt='forky'></img>
            <form className={classes.form}>
                <input className={classes.input} placeholder='Search your favorite recipe' type='text' id='site-search'></input>
                <button className={classes.button}>{glass} SEARCH</button>
            </form>
            <h1 className={classes.recipe}>ADD RECIPE</h1>
            <h1 className={classes.bookmarks}>BOOKMARKS</h1>
            {/* <Search placeholder="input search text" enterButton="Search" size="large" loading  onSearch={onSearch}/> */}
        </div>
    );
}

export default Header;
